# Define your function here
def SmartSquare (inlist, inplace):
    mylist = []

    if inplace == True:
        for n in range(len(inlist)):
            inlist[n -1] = inlist[n - 1] ** 2
        mylist.append(inlist)

    if inplace == False:
        for n in range(len(inlist)):
            inlist[n -1] = inlist[n - 1] ** 2
        mylist.append(inlist)



    print(inlist,mylist)



